// Contact.jsx
import React from 'react';
import '../assets/styles/App.css';
import sigilism from '../assets/imgs/sigilism-contact.png';

const Contact = () => {
  return (
    <div style={{ zIndex: '10', position: 'absolute', left: '10%', }}>
        <img src={sigilism} alt=""  />
    <div className="content">
      <h1 style={{ color: '#e96f7c', textAlign: 'center' }}>
        - Contact -
        <br />
        In maintenance
      </h1>
    </div>
    </div>
  );
};

export default Contact;
